import React, { useEffect, useState } from 'react';
import {
  Select,
  MenuItem,
  TextField,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  CircularProgress,
  Tooltip,
  IconButton,
  Switch,
  TablePagination,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Button,
  Snackbar,
  Alert,
  Typography
} from '@mui/material';
import { createTheme, ThemeProvider, styled } from '@mui/material/styles';
import RefreshIcon from '@mui/icons-material/Refresh';
import DownloadIcon from '@mui/icons-material/Download';
import SearchIcon from '@mui/icons-material/Search';
import CloseIcon from '@mui/icons-material/Close';

const DashboardContainer = styled("div")(({ theme }) => ({
  padding: 8,
  minHeight: "100vh",
  backgroundColor: theme.palette.background.default,
  color: theme.palette.text.primary,
}));

const TitleContainer = styled("div")({
  display: "flex",
  justifyContent: "center",
  alignItems: "center",
  marginBottom: 20,
  padding: "15px 0",
  backgroundColor: "#036649",
  borderRadius: "8px",
  color: "#ffffff",
  position: "relative",
});

const ControlsContainer = styled("div")(({ theme }) => ({
  display: "flex",
  justifyContent: "space-between",
  alignItems: "center",
  marginBottom: 20,
  backgroundColor: theme.palette.mode === "dark" ? "#333" : "#f7f7f7",
  padding: "10px",
  borderRadius: "8px",
  boxShadow: theme.shadows[3],
}));

const App = () => {
  const [data, setData] = useState([]);
  const [filteredData, setFilteredData] = useState([]);
  const [loading, setLoading] = useState(false);
  const [searchText, setSearchText] = useState("");
  const [darkMode, setDarkMode] = useState(false);
  const [page, setPage] = useState(0);
  const [rowsPerPage, setRowsPerPage] = useState(10);
  const [openDialog, setOpenDialog] = useState(false);
  const [selectedRow, setSelectedRow] = useState(null);
  const [openSnackbar, setOpenSnackbar] = useState(false);
  const [alertMessage, setAlertMessage] = useState("");

  const columns = [
    { id: 'vmname', label: 'VM Name' },
    { id: 'failedcounter', label: 'Failed Counter' },
    { id: 'ticket_created', label: 'Ticket Created' },
    { id: 'message', label: 'Error Message' }
  ];

  const theme = createTheme({
    palette: {
      mode: darkMode ? "dark" : "light",
      primary: { main: "#036649" },
      background: { default: darkMode ? "#121212" : "#f3f3f3" },
    },
  });

  const fetchData = async () => {
    setLoading(true);
    try {
      const response = await fetch("https://o2merk3yse.execute-api.us-east-1.amazonaws.com/dev/data");
      const result = await response.json();
      setData(result);
      setFilteredData(result);
      checkForFailures(result);
    } catch (error) {
      console.error("Error fetching data:", error);
      setAlertMessage("Failed to fetch data. Please try again.");
      setOpenSnackbar(true);
    } finally {
      setLoading(false);
    }
  };

  const checkForFailures = (data) => {
    const highFailures = data.some(item => parseInt(item.failedcounter) > 3);
    if (highFailures) {
      setAlertMessage("Critical alert: Multiple failures detected!");
      setOpenSnackbar(true);
    }
  };

  const handleSearch = (searchValue) => {
    setSearchText(searchValue);
    const filtered = data.filter(row =>
      Object.values(row).some(value =>
        value.toString().toLowerCase().includes(searchValue.toLowerCase())
      )
    );
    setFilteredData(filtered);
    setPage(0);
  };

  const handleRowClick = (row) => {
    setSelectedRow(row);
    setOpenDialog(true);
  };

  const exportToCSV = () => {
    const headers = columns.map(column => column.label).join(',');
    const csvData = filteredData.map(row =>
      columns.map(column => `"${row[column.id]}"`).join(',')
    ).join('\n');

    const blob = new Blob([`${headers}\n${csvData}`], { type: 'text/csv' });
    const url = URL.createObjectURL(blob);
    const link = document.createElement('a');
    link.href = url;
    link.download = `vm_monitoring_${new Date().toISOString()}.csv`;
    link.click();
  };

  useEffect(() => {
    fetchData();
  }, []);

  return (
    <ThemeProvider theme={theme}>
      <DashboardContainer>
        <TitleContainer>
          <Typography variant="h5" style={{ fontWeight: "bold" }}>
            VM Monitoring Dashboard
          </Typography>
          <div style={{ position: "absolute", right: 20 }}>
            <Switch checked={darkMode} onChange={() => setDarkMode(!darkMode)} />
          </div>
        </TitleContainer>

        <ControlsContainer>
          <TextField
            placeholder="Search"
            variant="outlined"
            onChange={(e) => handleSearch(e.target.value)}
            value={searchText}
            InputProps={{
              startAdornment: <SearchIcon style={{ marginRight: 8 }} />
            }}
          />
          <div>
            <Tooltip title="Refresh Data">
              <IconButton onClick={fetchData}>
                <RefreshIcon />
              </IconButton>
            </Tooltip>
            <Tooltip title="Export to CSV">
              <IconButton onClick={exportToCSV}>
                <DownloadIcon />
              </IconButton>
            </Tooltip>
          </div>
        </ControlsContainer>

        {loading ? (
          <CircularProgress style={{ display: "block", margin: "20px auto" }} />
        ) : (
          <TableContainer component={Paper}>
            <Table>
              <TableHead>
                <TableRow style={{ backgroundColor: "#036649" }}>
                  {columns.map((column) => (
                    <TableCell key={column.id} style={{ color: "#ffffff", fontWeight: "bold" }}>
                      {column.label}
                    </TableCell>
                  ))}
                </TableRow>
              </TableHead>
              <TableBody>
                {filteredData
                  .slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage)
                  .map((row, index) => (
                    <TableRow
                      key={index}
                      onClick={() => handleRowClick(row)}
                      hover
                      style={{ cursor: "pointer" }}
                    >
                      {columns.map((column) => (
                        <TableCell key={column.id}>
                          {row[column.id]}
                        </TableCell>
                      ))}
                    </TableRow>
                  ))}
              </TableBody>
            </Table>
            <TablePagination
              rowsPerPageOptions={[5, 10, 25]}
              component="div"
              count={filteredData.length}
              rowsPerPage={rowsPerPage}
              page={page}
              onPageChange={(_, newPage) => setPage(newPage)}
              onRowsPerPageChange={(event) => {
                setRowsPerPage(parseInt(event.target.value, 10));
                setPage(0);
              }}
            />
          </TableContainer>
        )}

        <Dialog open={openDialog} onClose={() => setOpenDialog(false)} maxWidth="md">
          <DialogTitle>
            VM Details
            <IconButton
              onClick={() => setOpenDialog(false)}
              style={{ position: "absolute", right: 8, top: 8 }}
            >
              <CloseIcon />
            </IconButton>
          </DialogTitle>
          <DialogContent dividers>
            {selectedRow && columns.map((column) => (
              <Typography key={column.id} paragraph>
                <strong>{column.label}:</strong> {selectedRow[column.id]}
              </Typography>
            ))}
          </DialogContent>
          <DialogActions>
            <Button onClick={() => setOpenDialog(false)} color="primary">
              Close
            </Button>
          </DialogActions>
        </Dialog>

        <Snackbar
          open={openSnackbar}
          autoHideDuration={6000}
          onClose={() => setOpenSnackbar(false)}
          anchorOrigin={{ vertical: "top", horizontal: "center" }}
        >
          <Alert onClose={() => setOpenSnackbar(false)} severity="error">
            {alertMessage}
          </Alert>
        </Snackbar>
      </DashboardContainer>
    </ThemeProvider>
  );
};

export default App;
